CREATE TABLE IF NOT EXISTS Customers (
    CustomerID UInt64,
    CustomerTypeID UInt8,
    Name String,
    DateOfBirth DateTime DEFAULT NULL,
    RegistrationDate DateTime DEFAULT NULL,
    TIN String,
    ContactInfo String
) ENGINE = MergeTree()
PARTITION BY CustomerTypeID
ORDER BY CustomerID;

CREATE TABLE IF NOT EXISTS CreditProducts (
    CreditProductID UInt64,
    ProductName String,
    InterestRate Float32,
    MaxLoanAmount Decimal(15, 2),
    MinRepaymentTerm UInt8,
    CollateralRequired String
) ENGINE = MergeTree()
ORDER BY CreditProductID;

CREATE TABLE IF NOT EXISTS CreditAgreements (
    CreditAgreementID UInt64,
    CustomerID UInt64,
    CreditProductID UInt64,
    AgreementDate DateTime,
    LoanAmount Decimal(15, 2),
    LoanTerm UInt8,
    InterestRate Float32
) ENGINE = MergeTree()
PARTITION BY toYYYYMM(AgreementDate)
ORDER BY CreditAgreementID;

CREATE TABLE IF NOT EXISTS TransactionTypes (
    TransactionTypeID UInt64,
    TransactionTypeName String
) ENGINE = MergeTree()
ORDER BY TransactionTypeID;

CREATE TABLE IF NOT EXISTS CreditTransactions (
    TransactionID UInt64,
    CustomerID UInt64,
    CreditAgreementID UInt64,
    TransactionDate DateTime,
    TransactionAmount Decimal(15, 2),
    TransactionTypeID UInt64
) ENGINE = MergeTree()
PARTITION BY toYYYYMM(TransactionDate)
ORDER BY TransactionID;






